Building wheels requires no setup, however, to activate all features of the wheel rules, a toolchain must be registered. First some external python requirements will be required. There is guidance on how to configure this in projects like rules_req_compile . Once there is a means to fetch external dependencies within your repository, a toolchain can be defined in a BUILD.bazel file. Example //:BUILD.bazel: load("@rules_venv//python/wheel:defs.bzl", "py_wheel_toolchain") py_wheel_toolchain( name = "py_wheel_toolchain_impl", # Definable using bzlmod modules like: https://github.com/periareon/req-compile twine = "@pip_deps//:twine", visibility = ["//visibility:public"],
) toolchain( name = "py_wheel_toolchain", toolchain = ":py_wheel_toolchain_impl", toolchain_type = "@rules_venv//python/wheel:toolchain_type", visibility = ["//visibility:public"],
) Once the toolchain is defined, it should be registered in the MODULE.bazel file Example //:MODULE.bazel: register_toolchains( "//:py_wheel_toolchain",
) This will ensure all features of the wheel rules are available and usable.

