ersions required by this distribution, e.g. '>=3.9,<3.13' None python_tag Supported Python version(s), eg py3, cp39.cp310, etc None strip_path_prefixes path prefixes to strip from files added to the generated package None summary A one-line summary of what the distribution does None version The version of the package. "0.0.0" distribution Name of the distribution. If unset, name will be used. None repository_url The repository (package index) URL to upload the wheel to. None kwargs Additional keyword arguments. none
